def is_subsequence(s, t)
  return true if s.empty?

  res = false
  t_index = 0

  loop do
    return true if s.empty?

    char = t[t_index]

    return false if char.nil?

    if s[0] == char
      s[0] = ''
    end

    t_index += 1
  end

  res
end

p is_subsequence('abc', 'ahbgdc') # true

p is_subsequence('axc', 'ahbgdc') # false

p is_subsequence('', 'ahbgdc') # true

p is_subsequence('aaaaaa', 'bbaaaa') # false

s = "leeeeetcode"
t = ""
p is_subsequence(s, t) # true
